import logo from './logo.svg';
import {useState} from "react";
import "./App.scss";

const App = () => {
  const [menuOpen, toggleMenu] = useState(false);
  return (
    <div className="App">
      <header>
        <input id="hamburger"
          type="checkbox"
          checked={menuOpen}
          onClick={() => {
            menuOpen? toggleMenu(false): toggleMenu(true);
          }}
        />
        <label id="hamburger__toggle" for="hamburger">
          <div />
          <div class="top" />
          <div class="bottom" />
        </label>
        <div id="logo">logo</div>
        <div id="menu">
          <ul>
          <li>one</li>
          <li>one</li>
          <li>one</li>
          <li>one</li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default App;
